$(function(){$(document).ready(function(){for(var b=1;b<10;b++){for(var a=1;a<15;a++){$("#selectable").append("<li class='ui-state-default' id="+(((a-1)*9)+b)+"></li>")}}});$("#selectable").selectable({stop:function(){var a=$("#select-result").empty();$("li").sort(function(d,c){return(~~d.id>~~c.id)?1:-1}).each(function(){var b=$(this).attr("class");if(b.indexOf("ui-selected")!=-1){a.append("1")}else{a.append("0")}})}})});